import data from '../data.json'
const infos= data.events


 export const allEvents = (state = infos, action) => {
  switch (action.type) {
    case "FETCH_DATA":
      
    case 'SELECT_SEAT':
      return {
        id:4,
        lo:8
      }
    default:
      return state;
  }
};
